if (response.data.responseData) {
    var atmLocations = response.data.responseData[0].foundATMLocations;
    for (var i = 0; i < atmLocations.length; i++) {
        var location = atmLocations[i];
        if (location && location.location && location.location.coordinates && location.location.placeName && location.location.address && location.location.address.formattedAddress) {
            var annotation = {
                 "long": location.location.coordinates.longitude,
                 "lat": location.location.coordinates.latitude,
                 "title": location.location.placeName,
                 "subtitle": location.location.address.formattedAddress,
                 "popover": {
                     "defaultLabel": "Pin"
                 }
             }
             if (!mapCenter) {
                 ADFBridgeService.widgetMap['VISA_ATMLocations_Group'].propertyHandler.behaviourProperties.defaultRegion.lat = location.location.coordinates.latitude;
                 ADFBridgeService.widgetMap['VISA_ATMLocations_Group'].propertyHandler.behaviourProperties.defaultRegion.long = location.location.coordinates.longitude;
                 ADFBridgeService.widgetMap['VISA_ATMLocations_Group'].propertyHandler.behaviourProperties.defaultRegion.latitudeDelta = 0.1;
                 ADFBridgeService.widgetMap['VISA_ATMLocations_Group'].propertyHandler.behaviourProperties.defaultRegion.longitudeDelta = 0.1;
                 mapCenter = true;
             }
             annotations.push(annotation);
         }
     }


      ADFBridgeService.widgetMap['VISA_ATMLocations_Group'].propertyHandler.data.annotations = annotations;
      ADFBridgeService.widgetMap['VISA_ATMLocations_Group'].propertyHandler.data.annotationsDefaultImage = 'dist/assets/images/VISA_AssetsContainer_PINLocationAtm.png';

      ADFBridgeService.removeComponent('VISA_ATMLocations_Group');



      ADFBridgeService.showWidget('VISA_ATMLocations_Group');

      ADFBridgeService.widgetMap['VISA_ATMLocations_Group'].propertyHandler.data.annotations = [];

}

